import React from "react";
import Jumbotron from "react-bootstrap/Jumbotron";

function ProjectBanner({ title, imgUrl }) {
  return (
    <Jumbotron
        className="h-75"
        style={{
            position: 'relative',
            backgroundImage: `url(${imgUrl})`
        }}
    >
      <h1 style={{ fontSize: "5rem" }}>{title}</h1>
    </Jumbotron>
  );
}

export default ProjectBanner;
